"use strict";

function f_gold(n) {
    let dp = Array.from({length: 10}, () => Array(10).fill(-1));
    let digit = [];
    while (n) {
        digit.push(n % 10);
        n = Math.floor(n / 10);
    }
    function dfs(pos, cnt, limit) {
        if (pos === -1) {
            return cnt;
        }
        if (!limit && dp[pos][cnt] !== -1) {
            return dp[pos][cnt];
        }
        let up = limit ? digit[pos] : 9;
        let ans = 0;
        for (let i = 0; i <= up; i++) {
            let nxt = i === 1 ? cnt + 1 : cnt;
            ans += dfs(pos - 1, nxt, limit && i === digit[pos]);
        }
        if (!limit) {
            dp[pos][cnt] = ans;
        }
        return ans;
    }
    return dfs(digit.length - 1, 0, true);
}
